import React from "react";
import { Parallax, Image } from "react-scroll-parallax";

import img from "../3_images/2_theInitiative/bg_initiative-banner-blur.jpg";

export default function TheOriginalSix() {
  return (
    <div>
      <Parallax className="custom-class" y={[-20, 20]} tagOuter="figure">
        <Image src={img} />
      </Parallax>
    </div>
  );
}
